import React from 'react';
import { Form, FormField, Button, Avatar,Text} from 'grommet';

function InputForm() {
    <Form key={1}>
      <FormField label="Device Class" width="large">
        <TextInput
          placeholder="Enter Device Class"
          defaultValue={device}
          onChange={(e) => setDevice(e.target.value)}
        />
      </FormField>
      <FormField label="Device Serial No." width="large">
        <TextInput
          placeholder="Device Serial No."
          defaultValue={type}
          onChange={(e) => setType(e.target.value)}
        />
      </FormField>
      <Button key={1}
        type="submit"
        alignSelf="center"
        primary
        label="Submit"
        onClick={handleSubmit}
      />
    </Form>

}


export default InputForm;
